  const [data,setData]=React.useState<HostsData[]>([]);

  const getProductData = async () => {
      try {
        const data = await axios.get<HostsData[]>(
          `https://my-json-server.typicode.com/sakthi-vunet/dummyhosts/list`
        );

        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();
  }, []);

  return (
    <Box
      component="main"
      sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}>
      <Toolbar />
    <h1> Hosts </h1>

</Box>

  );
};
